--
-- Name: prediction_formstm_v; Type: VIEW; Schema: public; Owner: vvladych
--

CREATE VIEW prediction_formstm_v AS
 SELECT a.uuid,
    a.prediction_commonname,
    a.fstate_uuid,
    a.fstate_probability,
    a.fsnumint_uuid,
    a.fstatebegin,
    a.fstateend,
    a.fsvalue,
    a.concept_uuid,
    a.concept_commonname,
    a.concept_datatype,
    a.concept_dimension,
    f.tmstatement_uuid,
    f.tmbegin,
    f.tmend
   FROM (( SELECT p.uuid,
            p.prediction_commonname,
            f_1.fstate_uuid,
            f_1.fstate_probability,
            f_1.fsnumint_uuid,
            p.fstatebegin,
            p.fstateend,
            ((round(lower(f_1.fsnumint_value), 3) || ','::text) || round(upper(f_1.fsnumint_value), 3)) AS fsvalue,
            c.concept_uuid,
            c.concept_commonname,
            c.concept_datatype,
            c.concept_dimension
           FROM prediction_fstate_v p,
            fstate_fsnumint_v f_1,
            fstate_concept_v c
          WHERE ((p.fstate_uuid = f_1.fstate_uuid) AND (f_1.fstate_uuid = c.fstate_uuid))
        UNION
         SELECT p.uuid,
            p.prediction_commonname,
            f_1.fstate_uuid,
            f_1.fstate_probability,
            f_1.fsboolean_uuid,
            p.fstatebegin,
            p.fstateend,
            (''::text || f_1.fsboolean_value) AS fsvalue,
            c.concept_uuid,
            c.concept_commonname,
            c.concept_datatype,
            c.concept_dimension
           FROM prediction_fstate_v p,
            fstate_fsboolean_v f_1,
            fstate_concept_v c
          WHERE ((p.fstate_uuid = f_1.fstate_uuid) AND (p.fstate_uuid = c.fstate_uuid))
        UNION
         SELECT p.uuid,
            p.prediction_commonname,
            f_literal.fstate_uuid,
            f_literal.fstate_probability,
            f_literal.fsliteral_uuid,
            p.fstatebegin,
            p.fstateend,
            f_literal.fsliteral_value AS fsvalue,
            c.concept_uuid,
            c.concept_commonname,
            c.concept_datatype,
            c.concept_dimension
           FROM prediction_fstate_v p,
            fstate_fsliteral_v f_literal,
            fstate_concept_v c
          WHERE ((p.fstate_uuid = f_literal.fstate_uuid) AND (p.fstate_uuid = c.fstate_uuid))) a
     LEFT JOIN fstate_tmstatement_v f ON ((a.fstate_uuid = f.fstate_uuid)));


ALTER TABLE prediction_formstm_v OWNER TO vvladych;

